INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(5, 'Dinamo prodao Kangu. Belgijci: Sutra dolazi na liječnički', 0, 'Transfer WILFRIEDA KANGE u belgijski Gent', 'WILFRIED KANGA, napadač GNK Dinama, napravit će transfer u belgijski Gent. Ekskluzivnu vijest objavio je pouzdani belgijski insajder Sacha Tavolieri. Navodi da će Kanga u nedjelju doći na liječnički pregled prije potpisa ugovora, a s klubom kojeg od ovog ljeta vodi bivši trener Hajduka Ivan Leko, potpisat će trogodišnji ugovor. Bjelokošćanin je bio jedan od igrača kojih se Boban želio riješiti ovog ljeta i sada je uspio u tome.\r\n\r\nKanga odlazi nakon samo jedne odigrane polusezone na Maksimiru. U siječnju je stigao iz Herthe za malo manje od dva milijuna eura odštete uz bonuse, a Kanga je imao plaću od oko 700 tisuća eura godišnje. Kada se zbroje sve stavke (odšteta, bonusi i plaća), ukupna vrijednost posla bila je oko četiri milijuna eura. Kanga je odigrao 16 utakmica i zabio tri gola.\r\n\r\n\r\nProšao je omladinsku školu PSG-a\r\nKanga je prošao omladinsku školu PSG-a, a u seniorski nogomet je ušao kroz francuski Angers. Igrao je i za turski Kayserispor, švicarski Young Boys te njemačku Herthu, koja ga je slala na posudbe u belgijski Standard Liege i velški Cardiff.\r\n\r\nDobra sezona u Young Boysima (16 golova i 5 asistencija) donijela mu je 2022. godine transfer od pet milijuna eura u Herthu. U ljeto 2024. godine je završio na posudbi u Cardiffu, ali se tamo nije snašao. Odigrao je 16 utakmica i nije postigao pogodak.\r\n\r\nLeko je početkom mjeseca predstavljen kao novi trener Genta\r\nHrvatski trener Ivan Leko napustio je Standard Liege na kraju sezone i potpisao trogodišnji ugovor s Gentom. To je šesti različiti klub za njega u Belgiji jer je uz spomenuti Standard vodio i Leuven, Sint-Truiden, Club Brugge te Royal Antwerp. Njegov pobjednički mentalitet, energija i ambicija bili su važni aduti pri izboru za ovo imenovanje, napisali su.\r\n\r\n\"Ovdje sam da gradim i pobjeđujem. Navijači mogu očekivati momčad koja se bori, igra nogomet i raste. Odabrao sam projekt i ljude Genta. Zajedno ćemo naporno raditi, s ambicijom za budućnost\", rekao je Leko u prvoj izjavi za klupsku stranicu. Leko je nakon kratkog odmora, baš proteklog ponedjeljka, 16. lipnja, prvi put upoznao momčad.\r\n\r\n', 'sport', , 'image/jpeg', '2025-06-21 18:31:19');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(6, 'Kovačeva Borussia u trileru sa sedam golova pobijedila Južnoafrikance', 0, 'BORUSSIA DORTMUND pobijedila Mamelodi Sundownse', 'BORUSSIA DORTMUND u napetoj je utakmici sa sedam golova pobijedila Mamelodi Sundownse 4:3 u drugom kolu skupine F Svjetskog prvenstva. Momčad Nike Kovača nije lagano došla do pobjede protiv južnoafričkog sastava, koji je poveo u 11. minuti poslije solo-akcije Lucasa Ribeira.\r\n\r\nBorussia je do poluvremena preokrenula rezultat golovima Felixa Nmeche i Serhoua Guirassyja, kao i prvijencem Jobea Bellinghama. Kada je Khuliso Madau u 59. minuti pogodio vlastitu mrežu, činilo se da će Dortmund lako do slavlja, ali Sundownsi se nisu predavali.\r\n\r\nIqraam Rayners smanjio je na 4:2 u 62. minuti, a Lebo Mothiba je u 90. pogodio za napetu završnicu. Ipak, Borussia je sačuvala prednost do kraja utakmice. Kovačeva ekipa nakon dva kola ima četiri boda, dok su Sundownsi na tri. \r\n\r\n', 'sport', , 'image/jpeg', '2025-06-21 18:32:24');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(7, 'Plasirale su se na EuroBasket ispred Hrvatske. Sada su izgubile 74 razlike', 0, 'KOŠARKAŠICE Francuske pobijedile na EuroBasketu', 'KOŠARKAŠICE Francuske ostvarile su danas povijesnu pobjedu na EuroBasketu demoliravši reprezentaciju Švicarske čak 111:37 u okviru trećeg kola grupne faze. Tih 74 poena razlike novi je rekord natjecanja u 21. stoljeću. Svih 12 Francuskinja upisalo se u strijelce, a najefikasnija bila je Janelle Salaun s 23 poena. Kod poraženih je dvoznamenkasta bila samo Evita Herminjard s 10 poena.\r\n\r\nFrancuskinje su Švicarke ostavile na jednoznamenkastom broju poena u tri od četiri četvrtine. Švicarske košarkašice zabile su 9 poena u prvoj dionici, 5 u drugoj, a 8 u četvrtoj. Najefikasnije bile su u trećoj, kada su zabile 15 poena. Ovo je Švicarkama bio povratak na europsku smotru poslije 69 godina, a grupnu fazu su neslavno završile.\r\n\r\nFrancuska je srušila rekord Rusije\r\nOvom pobjedom Francuska je postavila novi rekord EuroBasketa za žene po pobjedi s najvećom razlikom u 21. stoljeću, nadmašivši dosadašnjih +48, koje je postigla Belgija protiv Izraela 2023. godine (106:58). Ovo je inače 14. najveća pobjeda u povijesti natjecanja, s time da rekord drži Sovjetski savez, koji je 1952. godine sa 133:4 pobijedio Istočnu Njemačku.\r\n\r\nFrancuskinje su ovom pobjedom grupnu fazu završile s omjerom 3:0 te su izborile plasman u četvrtfinale i najavile pohod na medalju, dok Švicarsku čeka razigravanje za mjesta.\r\n\r\nŠvicarska je otišla na prvenstvo ispred Hrvatske\r\nPlasman na Europsko prvenstvo izborilo je 16 reprezentacija uključujući četiri domaćina, Češku, Italiju, Njemačku i Grčku. Uz njih, na turnir je išlo osam pobjednika skupina i četiri najbolje drugoplasirane reprezentacije.\r\n\r\nŠvicarska je upravo u tom poretku zauzela četvrto mjesto, posljednje koje vodi na turnir s omjerom 4:2 i koš razlikom +58. Hrvatske košarkašice bile su prve ispod crte, pete, za samo devet poena razlike.\r\n\r\nHrvatska je imala poznatu računicu pred posljednju utakmicu kvalifikacija protiv Austrije. Bila im je potrebna pobjeda od barem 18 razlike kako bi potvrdile drugo mjesto u skupini iz Španjolske, ali i osigurale jednu od četiri karte za drugoplasirane ekipe. Hrvatice su imale +23, te +21 samo pet minuta prije kraja, no u preostalom vremenu zabile su tek dva poena, a primile 14 i tako slavile s nedovoljnih +8.\r\n\r\n', 'sport', , 'image/jpeg', '2025-06-21 18:33:20');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(8, 'Jedan od najvećih zagovaratelja bjegunca Mamića postao predsjednik Matice hrvatske', 0, 'Za predsjednika izabran Damir Zorić', 'NA GLAVNOJ izbornoj skupštini Matice hrvatske za novog je predsjednika izabran dosadašnji potpredsjednik Damir Zorić, a osim predsjednika, izabrani su članovi svih upravnih tijela u novom četverogodišnjem mandatu.\r\n\r\n\"Matica hrvatska okuplja ljude kojima je na srcu hrvatska kultura i vrijednosti hrvatske baštine na svim poljima stvaranja. Upravo je Matica hrvatska, čuvajući i promičući hrvatsku kulturu i domoljublje, činila i čini da postignuća ranijih naraštaja ne ostanu samo mrtva ili zaboravljena prošlost\", rekao je novi predsjednik Zorić na skupštini održanoj u Srednjoj školi Čakovec.\r\n\r\nNovo vodstvo i prioriteti\r\nUz predsjednika, novo Predsjedništvo čini još šest članova: Mario Jareb, Božidar Petrač i Dražen Švagelj (potpredsjednici), glavni tajnik Ivica Nuić, gospodarski tajnik Ivica Završki i književni tajnik Vladimir Lončarević.\r\n\r\nMeđu prioritetima u narednom mandatu je obnova Matičine palače u središtu Zagreba.\r\n\r\nOsvrt na postignuća dosadašnjeg vodstva\r\nDosadašnji predsjednik Miro Gavran u svom se govoru osvrnuo na najvažnija postignuća tijekom mandata na čelu Matice hrvatske. Među njima izdvaja pokretanje tribine \"Sučeljavanja u Matici hrvatskoj\", kao i pokretanje portala Misao.hr i podcasta. Također je spomenuo donošenje Zakona o hrvatskom jeziku, četiri uspješna Festivala knjige u Matici hrvatskoj te pristupanje 2350 novih članova.\r\n\r\nNakon izbora predsjednika i članova upravnih tijela, Skupština je usvojila niz dokumenata kao što su Izvješće o radu, Financijsko izvješće i Revizorsko izvješće za 2024. godinu, Izvješća Nadzornoga odbora i Časnoga suda, te prijedlog Financijskog plana i Plana rada za 2026. godinu.\r\n\r\nBio Mamićev igrač u Dinamu nakon bijega u BiH\r\nDamir Zorić je ranije bio šef Hrvatske udruge poslodavaca.\r\n\r\nInače je poznat i po tome što je bio Dinamov skupštinar koji je predvodio struju mamićevaca - ljudi odanih bjeguncu Zdravku Mamiću, osuđenom za kriminal u Građanskom nogometnom klubu Dinamo. Zorić je, nakon što je Mamić pobjegao u BiH, ostao možda i njegov najveći zagovaratelj, advokat i branitelj njegovih interesa u Dinamu, a slovio je i kao Mamićev kandidat za predsjednika Dinama. \r\n\r\nNa kraju je sadašnji predsjednik Matice hrvatske izbačen iz članstva Dinama zbog povrede klupske časti i ugleda. \r\n\r\n', 'politika', , 'image/jpeg', '2025-06-21 18:34:25');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(9, 'Hrvat predložen za potpredsjednika Pokrajinske vlade Vojvodine', 0, 'Žigmanov predložen je za potpredsjednika PV APV', 'PREDSJEDNIK Demokratskog saveza Hrvata u Vojvodini (DSHV) i bivši ministar u srbijanskoj vladi Tomislav Žigmanov predložen je za potpredsjednika Pokrajinske vlade Autonomne pokrajine Vojvodine (APV), objavio je vojvođanski tjednik Hrvatska riječ, dodajući kako bi na novu dužnost trebao biti imenovan na sjednici Skupštine APV-a 25. lipnja.\r\n\r\nPrijedlog za imenovanje Žigmanova na funkciju potpredsjednika Skupštini APV-a podnijela je Maja Gojković, predsjednica Pokrajinske vlade i članica Predsjedništva vladajuće Srpske napredne stranke (SNS).\r\n\r\nU obrazloženju prijedloga navodi se da se \"u sastav Vlade bira još jedan potpredsjednik Pokrajinske vlade, čime bi se pridonijelo jačanju institucionalnog okvira, poboljšanju međuresorne suradnje državnih tijela i drugih institucija te provedbi obveza zaštite i unaprjeđenja ljudskih prava, s posebnim prioritetom\".\r\n\r\nDodaje se da Žigmanov posjeduje iskustvo u području ljudskih i manjinskih prava, pa će \"njegov izbor za potpredsjednika Pokrajinske vlade dodatno osnažiti kapacitete Vlade u unaprjeđenju zaštite ljudskih prava\".\r\n\r\nU dva mandata bio ministar za ljudska i manjinska prava\r\nPredsjednik DSHV-a Žigmanov nije komentirao vijest, no reagirao je njegov zamjenik Goran Kaurić koji posljednjih mjeseci iznosi javne kritike što, kako navodi, čelnik stranke ne konzultira članstvo i vodstvo o svojim kontaktima s predstavnicima vladajućih struktura.\r\n\r\nPo njegovim riječima, prema Statutu DSHV-a jedino Vijeće stranke može utvrditi kandidate za imenovanje u izvršnu vlast, a sjednice Vijeća na tu temu nije bilo. Ako skupštinska većina na sjednici 25. lipnja u Novom Sadu usvoji prijedlog, Tomislav Žigmanov postat će peti potpredsjednik Pokrajinske vlade APV-a, navodi Hrvatska riječ.\r\n\r\nTomislav Žigmanov je od 2022. u dva mandata bio srbijanski ministar za ljudska i manjinska prava, no tu je poziciju izgubio u travnju kada je formirana nova Vlada Srbije. DSHV je najstarija i najjača politička organizacija Hrvata u Srbiji, a Žigmanov je na njezinu čelu od 2015.\r\n\r\n', 'politika', , 'image/webp', '2025-06-21 18:35:21');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(10, 'Predsjednik Crne Gore: Zatražio sam od Plenkovića da odblokira poglavlje 31', 0, 'Crna Gora ispunila tehničke aspekte', 'CRNOGORSKI predsjednik Jakov Milatović poručio je da je Crna Gora ispunila tehničke aspekte iz pregovaračkog poglavlja 31 te da su u posljednjim tjednima napravljeni koraci prema njegovom potencijalnom zatvaranju. Navedeno poglavlje odnosi se na vanjsku, sigurnosnu i obrambenu politiku.\r\n\r\nMilatović je napomenuo da se u Odesi susreo s hrvatskim premijerom Andrejom Plenkovićem i zatražio u ime Crne Gore da Hrvatska odblokira zatvaranje poglavlja 31. Naglasio je kako se nada da će taj razgovor s Plenkovićem uroditi plodom, piše portal Vijesti.me.\r\n\r\nPonovio je kako je i Europska komisija utvrdila kako je Crna Gora ispunila tehničke aspekte iz spornog poglavlja, ali da zbog određenih bilateralnih stvari postoji kočenje od Hrvatske.\r\n\r\n\"Mislim da su i delegacije ministarstava vanjskih poslova Crne Gore i Hrvatske u prethodnom razdoblju imali par dobrih razgovora. Dolazak predsjednika Hrvatske Zorana Milanovića prije par tjedana u Crnu Goru i moj razgovor s Plenkovićem bili su koraci k potencijalnom zatvaranju poglavlja\", istaknuo je Milatović.\r\n\r\nLani u prosincu zatvorili tri poglavlja\r\nVeleposlanici država članica Europske unije su u prosincu prošle godine odobrili zatvaranje triju pregovaračkih poglavlja s Crnom Gorom, ali četvrto nije zatvoreno zbog protivljenja Hrvatske.\r\n\r\n\"Hrvatska sigurno neće stavljati bilateralna pitanja kao uvjet za europski put Crne Gore, ali pitanje nestalih osoba za vrijeme Domovinskog rata, pitanje odštete logoraša, to su teme koje nas sve unutar Europske unije moraju brinuti, a ne samo Hrvatsku\", poručio je tada hrvatski ministar vanjskih poslova Gordan Grlić Radman.\r\n\r\n', 'politika', , 'image/webp', '2025-06-21 18:35:55');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(11, 'Mladi hrvatski vaterpolisti osvojili broncu na Svjetskom prvenstvu', 0, 'Brončana medalja na Svjetskom prvenstvu', 'MLADA hrvatska U-20 vaterpolska reprezentacija osvojila je brončanu medalju na Svjetskom prvenstvu u Zagrebu. Hrvatska je u dvoboju za treće mjesto pobijedila Mađarsku rezultatom 13:8 i tako došla do novog velikog uspjeha. Ova generacija je prošle godine postala europski prvak do 19 godina.\r\n\r\nHrvatsku je do trijumfa predvodio fenomenalni golman Mauro Ivan Čubranić, koji je upisao čak 22 obrane, dok su najefikasniji bili Luka Penava i Vlaho Pavlić s po četiri gola. Kod poraženih je tri gola zabio Maxim Cseh, a dva Oliver Leinweber. Hrvatska je ovako uzvratila Mađarskoj za 15:11 poraz u grupnoj fazi natjecanja.\r\n\r\nDvoboj je prelomila 7:0 serija Hrvatske\r\nMađari su bolje započeli utakmicu, pa su golovima Olivera Leinwebera i Zalana Marka Nagyja poveli s 2:0 poslije samo tri minute igre. Ipak, nakon toga je počeo briljirati Mauro Ivan Čubranić na golu Hrvatske, dok je i napad počeo funkcionirati. Golovi Mare Šušića, Mislava Ćurkovića, Karla Dragoševića i Luke Penave, odveli su Hrvatsku do 4:2 na prvom odmoru.\r\n\r\nNisu se hrvatski vaterpolisti na tome zaustavili, već su s nova tri gola došli do ogromne prednosti od 7:2. Hrvatska je na poluvrijeme otišla s vodstvom od 8:4, dok je s nova dva gola Penave sredinom treće dionice došla do najvećih +6 (10:4).\r\n\r\nHrvatska je nakon toga stala i nije zabila gol gotovo punih 10 minuta, što je Mađarska iskoristila za 3:0 seriju i prilazak na -3. Dvije minute i 13 sekundi prije kraja, Pavlić je zabio za 11:7 i tako otklonio pitanje pobjednika. Večeras za zlato na bazenu Mladosti igraju vaterpolisti Španjolske i SAD-a.\r\n\r\n', 'sport', , 'image/jpeg', '2025-06-21 19:06:01');
INSERT INTO `articles` (`id`, `title`, `archive`, `summary`, `content`, `category`, `image`, `image_type`, `created`) VALUES
(12, 'SAD napao Iran. Iranci zasuli Izrael raketama, kreću evakuacije iz Izraela', 1, 'SAD napao iranska nuklearna postrojenja', 'U RANIM jutarnjim satima Sjedinjene Države izvele su napad na tri iranska nuklearna postrojenja - Fordo, Natanz i Isfahan. Riječ je o najsnažnijem napadu na iranski nuklearni program dosad. Šest nevidljivih bombardera B-2 Spirit bacilo je ukupno 12 bombi za probijanje bunkera GBU-57 na ultrautvrđeni podzemni kompleks Fordo, dok su američke podmornice ispalile 30 krstarećih raketa na postrojenja u Natanzu i Isfahanu.\r\n\r\nNakon višednevnih razmatranja Trumpova odluka da se pridruži izraelskom vojnom pohodu protiv Irana zaoštrila je sukob.\r\n\r\nNekoliko sati nakon napada, Trump se obratio naciji. Prema njegovim riječima,  jutrošnjem američkom bombardiranju potpuno su uništena tri iranska nuklearna postrojenja, Natanz, Esfahan i Fordow.\r\n\r\n\"Ili će biti mir ili će Iranu uslijediti znatno veća tragedija od one kojoj svjedočimo proteklih osam dana\", izjavio je Trump u govoru u Bijeloj kući, nazvavši Iran \"nasilnikom Bliskog istoka\" te poručio: \"Ako mir ne nastupi brzo, napast ćemo druge ciljeve precizno, brzo i vješto.\"\r\n\r\nMeđunarodna agencija za atomsku energiju objavila da zasad nema povišenih razina radijacije na pogođenim lokacijama. Iran je najavio da će se braniti od \"zločinačke agresije SAD-a\" te je raketama zasuo Izrael.', 'politika', , 'image/jpeg', '2025-06-22 10:16:54');

